import { useState } from "react";

const useCounting = () => {
  const count = (cost,defvalue) => {
    return {
      value: cost < defvalue ? cost - cost + 520 : cost,
      message: cost > defvalue ? cost * 0.014:cost
    };
  };




}
export default useCounting;
